import styled from 'styled-components'

export const Styles =styled.div`

table{
    border-spacing:0;
    border:1px solid rgba(0,0,0,1);

    th,td{
        padding:25px;
    
    }
    
    th{
        background:#a7aaab;
        color:white;
        border-bottom:3px solid #747778;
        font-family: cursive;
        font-weight: 900;
         font-size: 20px;
        
    }

    td{
        color:rgba(120, 116, 116,0.7);
        padding: 20px;
        font-size: 18px;
        font-weight: 550;
        font-family: system-ui;
    }
}


`
